export default [
    {
        title: "Admin",
        url: "/",
        template: "finder",
    },
    {
        role: "group",
        icon: "event",
        title: "Objekter",
        url: "/artifacts",
        layout: "masonry",
        query: {
            models: "documents",
            documentType: "artifact",
            sort: "updatedAt DESC"
        },
        children: [
            {
                title: "Design",
                url: "/artifacts/design",
                query: {
                    models: "documents",
                    documentType: "artifact",
                    sort: "updatedAt"
                },
            }
        ]
    },
    {
        role: "group",
        icon: "image",
        title: "Media",
        url: "/art/media",
        query: {
            models: "media",
            documentType: "ticket",
            sort: "createdAt"
        },
        children: [
            {
                title: "Upload",
                url: "/art/media/upload",
            }
        ]
    },
]
